import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { fab } from '@fortawesome/free-brands-svg-icons';
import './styles.css';

export default function Contact() {
    return (
        <div className="Body bg-dark p-5">
            <div>
                <div className="container-fluid pb-4">
                    <div className="row">
                        <a className="col-sm"> <FontAwesomeIcon icon={["fab", "linkedin"]} /> </a>
                        <a className="col-sm"> <FontAwesomeIcon icon={["fab", "github"]} /> </a>
                        <a className="col-sm"> <FontAwesomeIcon icon={["fab", "twitter"]} /> </a>
                    </div>
                </div>
                <h4 className="text-light">Nikolaj Johannes Skole Jensen</h4>
                <h6 className="text-danger">Personal</h6>
                <h6 className="text-light">nikolajjsj@gmail.com</h6>
                <h6 className="text-danger">Developer</h6>
                <h6 className="text-light">nikolaj.app.dev@gmail.com</h6>
            </div>
        </div>
    )
}
